import React, { useState, useEffect } from 'react';
import '..styles/ComingSoon.css'; // Using the same CSS you provided

const SimpleComingSoon = () => {
  const [email, setEmail] = useState('');
  const [isSubmitted, setIsSubmitted] = useState(false);
  const [days, setDays] = useState(0);
  
  useEffect(() => {
    // Simple countdown - just days
    const launchDate = new Date();
    launchDate.setDate(launchDate.getDate() + 30);
    const daysLeft = Math.floor((launchDate - new Date()) / (1000 * 60 * 60 * 24));
    setDays(daysLeft);
  }, []);
  
  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Notify email:', email);
    setIsSubmitted(true);
    setEmail('');
    setTimeout(() => setIsSubmitted(false), 3000);
  };
  
  return (
    <div className="coming-soon-container">
      <div className="coming-soon-content">
        <h1 className="coming-soon-title">
          <span className="gradient-text">Coming Soon</span>
        </h1>
        
        <p className="coming-soon-description">
          Our new feature will be ready in {days} days!
        </p>
        
        <div className="notification-form">
          <h2 className="form-title">
            Get Notified When We Launch
          </h2>
          
          {isSubmitted ? (
            <div className="success-message">
              Thank you! We'll notify you when we launch.
            </div>
          ) : (
            <div>
              <div className="input-group">
                <input
                  type="email"
                  placeholder="Enter your email"
                  value={email}
                  onChange={(e) => setEmail(e.target.value)}
                  className="email-input"
                />
                <button 
                  onClick={handleSubmit}
                  className="submit-btn"
                >
                  Notify Me
                </button>
              </div>
            </div>
          )}
        </div>
        
        <div className="coming-soon-footer">
          <p>Contact us at <a href="mailto:info@realestate.com">info@realestate.com</a></p>
          <button 
            className="back-btn"
            onClick={() => window.history.back()}
          >
            Back to Dashboard
          </button>
        </div>
      </div>
    </div>
  );
};

export default SimpleComingSoon;
